import React from 'react';
import { Link } from 'react-router-dom';
import './Button.css';

export const Button = ({ children, type, onClick, to }) => (
  <Link to={to} className='btn-mobile'>
    <button className='btn' onClick={onClick} type={type}>
      {children}
    </button>
  </Link>
);
